  ICROSSE, John Anthony and CROSSE, Pamela
  02> CROSSE, John Anthony m on 10.04.1954 to CROSSE, Pamela
  b 17.11.1925
  b 18.11.1915 d 02.11.1990
  Divorced 1969. Address: 2526 West 6th Avenue, Vancouver, BC V6K IW5, Canada.
  John was educated at Marlborough College, Kings College, Cambridge (MA) and Perdue University, USA
  (MSc). He won the University Pair Oars at Cambridge in 1948. During WW2 he was a Lieutenant (A)
  (A/E)RNVR. Afterwards he was an industrial engineer, management consultant, Assistant Professor at the
  Faculty of Commerce, University of British Columbia and, in 1965/66, with the Industrial Development
  Bank . Commodore of the Eagle Sailing Club in 1966, John is a Marine Historian and author.
  After a brief period with the WRENs, Pamela worked for Special Operations Executive at Baker Street.
  She was Gubbins' second recruit and, inter alia, was responsible for making out forged documents for
  Women Agents and ferrying them to the Moon Squadron at Tangmere. After the war she worked for the
  United Nations in Geneva and Paris, and as a volunteer for the Cheshire Homes, also as secretary to the
  Sacred Heart Convent in Vancouver, and the Kinsman's Foundation. In later years she took up water
  colour painting and became an established artist.
  Publications by J A Crosse
  "Thermoplyae and the Age of Clippers", Historian Publishers, Sydney, NSW, 1968.
