  b 02.05.1930
  b 28.11.1930
  Simon b. at Christchurch and m. at Lindfield, Sussex, England. Divorced 1995. Sheila, d/o Wilfred
  Henry Upjohn and Dorothy Leonora Olive Victoria Scutt, b. at Ipswich, England.
  01> CROSSE, Lucy Sarah
  b 08.03.1960
  Lucy b. at London, England, Address: 121 Felsham Road, Putney, London SW18 1BA, England.
  Lucy was educated at Norwich High School and after obtaining her "A" Levels in English, History and
  Geography, she started her career in the television industry. After fifteen years with Anglia
  Television in both Norwich and London, she joined Television New Zealand an international buyer of
  children's television programmes. She currently works for the Discovery Channel selling
  documentary programmes worldwide.
